(function() {
    'use strict';
    var prefixAudioBase64 = 'data:audio/wav;base64,';
var pew = new Audio(prefixAudioBase64 + ''),
        headshot = new Audio(prefixAudioBase64 + ''),
        multiKill = new Audio(prefixAudioBase64 + ''),
        killingspree = new Audio(prefixAudioBase64 + ''),
        rampage = new Audio(prefixAudioBase64 + ''),
        mmmmmultikill = new Audio(prefixAudioBase64 + '');
    var i = 0;
    document.body.addEventListener("mousedown", () => {
        pew.pause();
        pew.currentTime = 0;
        i++;
        pew.play();
        if (!(i%2)) headshot.play();
       switch (i){
           case 3:
               multiKill.play();
               break;
           case 5:
               killingspree.play();
               break;
           case 7:
               rampage.play();
               break;
           case 9:
               mmmmmultikill.play();
               i=0;
               break;
       }
    });
})();
